import React from 'react'
import Contactusimg from './images/banner7imgd.png'
import './contactus.css';
import {FaFacebookF,FaWhatsapp,FaInstagram,FaTwitter } from 'react-icons/fa';


function contactus() {



function Submit(){
let name = document.getElementById("name").value
let email = document.getElementById("email")
let phone = document.getElementById("number")
let adress = document.getElementById("adress")
let place= document.getElementById("place")

if (name=="") {
  document.getElementById("name").innerHTML="enter a name"
}else{
  document.getElementById("name").innerHTML=""
}

}


  return (
    <div className='maindiv'>
       <div className='inputdata'>
        <input type='text'placeholder='Name' ></input>
        <p id='name'> </p>
        <input type='email'placeholder='@Email' ></input>
        <p id="email"> </p>
        <input type='number'placeholder='Phone number' ></input>
        <p id='number'> </p>
        <input type='text'placeholder='Address'></input>
        <p id='address'> </p>
        <input type='text'placeholder='Place' ></input>
        <p id='place'></p>  
      
        <button onClick={Submit}> Submit</button>
        </div>
      <div className='contactusimg'>
        <img src={ Contactusimg} className='imgcontact' alt=''></img>
        <div className='c-text'>
         <h4 className='icons' ><FaFacebookF className='fa' />Facebook</h4> 
         <h4 className='icons' >< FaWhatsapp className='fa'/>Whatsapp</h4> 
         <h4 className='icons'>< FaInstagram className='fa'/>Instagram</h4>
         <h4 className='icons'>< FaTwitter className='fa'/>Twitter</h4>
         
   
        
         
         
   
         
        </div>
      </div>
     

    
    </div>
  
  )
}


export default contactus
